(26, '2016-02-18 02:30:08', 'Fwd: Carol Wirtti Sanches marcou você no Facebook', 'Jorge Luiz Gomes da Silva', 'jorge.silva.msbr@gmail.com', '[Leaf] - Jorge Silva', '', 'Jorge Luiz Gomes da Silva', 65, '<div dir="ltr"><br><br><div class="gmail_quote"><div dir="ltr">---------- Forwarded message ---------<br>From: Facebook &lt;<a href="mailto:notification%2Bzrdoihdzeid1@facebookmail.com">notification+zrdoihdzeid1@facebookmail.com</a>&gt;<br>Date: qua, 17 de fev de 2016 às 21:48<br>Subject: Carol Wirtti Sanches marcou você no Facebook<br>To: Jorge Luiz &lt;<a href="mailto:jorge.silva.msbr@gmail.com">jorge.silva.msbr@gmail.com</a>&gt;<br></div><br><br><u></u><div style="margin:0;padding:0" dir="ltr" bgcolor="#ffffff"><table style="border-collapse:collapse" border="0" cellpadding="0" cellspacing="0" width="100%;"><tbody><tr><td style="font-family:Helvetica Neue,Helvetica,Lucida Grande,tahoma,verdana,arial,sans-serif;background:#ffffff"><table style="border-collapse:collapse" cellpadding="0" cellspacing="0" width="100%"><tbody><tr><td style="line-height:20px" colspan="3" height="20"> </td></tr><tr><td colspan="3" style="line-height:1px" height="1"><span style="color:#ffffff;display:none!important;font-size:1px">  Carol Wirtti Sanches marcou você em uma publicação.       Carol Wirtti Sanches 17 de fevereiro às 20:48   Durante toda a minha carreira na área de TI, não tem nada melhor do que você realmente ver o resultado do trabalho de pessoas envolvidas no processo !! Colocar um sistema em produção e ver que realmente todo o trabalho valeu a pena , pra mim , é uma das melhores coisas !! Amo o que eu faço e sei que tudo não são flores e que o caminho é longo!! Errar faz parte!! Tropeçar, cair e continuar andando e melhorar a cada dia é o que faz a pessoa crescer !!!O importante é: Trabalhar e ter amor no que você faz, com isso o resultado por pior que seja é satisfatório !!! Obrigado a todo o time Glauber Laender , Jorge Luiz , Higor Nucci , Bruno Delgado , Samuel Cavalcante , Magno De Santana Silva e Thiago ( sem face kkkk)))Ver a felicidade de vocês hoje, foi sensacional!!! E obrigado pela paciência ao me acolherem tão bem nesse novo desafio !!! Tamo junto galera <img style="margin:0 0.2ex;vertical-align:middle" alt="????">????<img style="margin:0 0.2ex;vertical-align:middle" alt="????">????<img style="margin:0 0.2ex;vertical-align:middle" alt="????">????<img style="margin:0 0.2ex;vertical-align:middle" alt="????">????   Agora, você pode marcar seus amigos em seu status ou suas publicações. Digite @ e o nome do amigo. Por exemplo: &quot;Almocei com @João Andrade&quot;.   Saiba mais sobre marcação no Facebook .  </span></td></tr><tr><td style="display:block;width:15px" width="15">   </td><td><table style="border-collapse:collapse" cellpadding="0" cellspacing="0" width="100%"><tbody><tr><td style="line-height:16px" colspan="3" height="16"> </td></tr><tr><td style="height:32;line-height:0px" align="left" valign="middle" width="32"><a href="https://www.facebook.com/n/?carolwirtti.sanches%2Fposts%2F1252246418125646&amp;aref=1455752917206520&amp;medium=email&amp;mid=52bff99ecc326G5af3692e8b55G52bffe382c5f8G52Gd865&amp;bcode=1.1455756524.AbkK_f5Xdxtubmmp&amp;n_m=jorge.silva.msbr%40gmail.com&amp;lloc=1st_cta" style="color:#3b5998;text-decoration:none" target="_blank"><img src="https://fbstatic-a.akamaihd.net/rsrc.php/v2/yk/r/_2faPUZhPI6.png" style="border:0" height="32" width="32"></a></td><td style="display:block;width:15px" width="15">   </td><td width="100%"><a href="https://www.facebook.com/n/?carolwirtti.sanches%2Fposts%2F1252246418125646&amp;aref=1455752917206520&amp;medium=email&amp;mid=52bff99ecc326G5af3692e8b55G52bffe382c5f8G52Gd865&amp;bcode=1.1455756524.AbkK_f5Xdxtubmmp&amp;n_m=jorge.silva.msbr%40gmail.com&amp;lloc=1st_cta" style="color:#3b5998;text-decoration:none;font-family:Helvetica Neue,Helvetica,Lucida Grande,tahoma,verdana,arial,sans-serif;font-size:19px;line-height:32px" target="_blank">Facebook</a></td></tr><tr style="bord