(22, '2016-01-26 20:57:07', 'Fwd: 26 de janeiro - Devocional Diário CHARLES SPURGEON', 'Jorge Luiz Gomes da Silva', 'jorge.silva.msbr@gmail.com', '[Leaf] - Jorge Silva', '', 'Jorge Luiz Gomes da Silva', 56, '<div dir="ltr"><br><br><div class="gmail_quote"><div dir="ltr">---------- Forwarded message ---------<br>From: Voltemos ao Evangelho &lt;<a href="mailto:informativo@ministeriofiel.com.br">informativo@ministeriofiel.com.br</a>&gt;<br>Date: ter, 26 de jan de 2016 às 08:39<br>Subject: 26 de janeiro - Devocional Diário CHARLES SPURGEON<br>To:  &lt;<a href="mailto:jorge.silva.msbr@gmail.com">jorge.silva.msbr@gmail.com</a>&gt;<br></div><br><br><u></u>\r\n\r\n\r\n	\r\n	\r\n	\r\n\r\n<div bgcolor="#F1F1F1" marginheight="0" marginwidth="0" style="margin:0;padding:0">\r\n<table style="border-collapse:collapse" bgcolor="#F1F1F1" border="0" cellpadding="0" cellspacing="0" height="100%" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<div style="font-size:1px;color:#ffffff;line-height:1px;max-height:0px;max-width:0px;overflow:hidden">Receba os devocionais diários do Spurgeon!</div>\r\n			\r\n\r\n			<table style="max-width:583px;margin:auto" align="center" border="0" cellpadding="0" cellspacing="0" width="100%">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<div>\r\n						<table bgcolor="#ffffff" border="0" cellpadding="0" cellspacing="0" width="100%">\r\n							<tbody>\r\n								<tr>\r\n									<td style="padding-top:0%" align="center" valign="middle"><a href="http://informativo.ministeriofiel.com.br/sendy/l/PaHUf8e7c763Fqrvge763GpLSA/8c56yn3SDS2BGilXTW37Qg/JYr5892DmJA4785grH892rOUxQ" target="_blank"><img alt="" src="https://s3-us-west-2.amazonaws.com/ministeriofiel/DEZ+2015+devocional+Spurgeon/header.jpg" style="margin:auto" align="middle" border="0" width="583"> </a></td>\r\n								</tr>\r\n								\r\n								<tr>\r\n									<td style="padding:4%;font-family:sans-serif;font-size:15px;line-height:1.3;color:#666666;text-align:justify">\r\n									<p style="text-align:justify">&quot;<i>Vosso Pai celeste.</i>&quot; (Mateus 6.26)</p>\r\n\r\n									<p>Sem dúvida alguma, o povo de Deus é duas vezes filho de Deus: são a descendência de Deus por criação e filhos dele por adoção, em Cristo, Por isso, desfrutam do privilégio de chama-Lo “Pai nosso, que estás nos céus”.</p>\r\n									\r\n\r\n									<center>\r\n									<div><a href="http://informativo.ministeriofiel.com.br/sendy/l/PaHUf8e7c763Fqrvge763GpLSA/8c56yn3SDS2BGilXTW37Qg/JYr5892DmJA4785grH892rOUxQ" style="background-color:#0058af;background-image:url(https://s3-us-west-2.amazonaws.com/ministeriofiel/NOV+2015+mapa+de+igrejas/blue+buttons.gif);border:0px;border-radius:4px;color:#ffffff;display:inline-block;font-family:sans-serif;font-size:13px;font-weight:bold;line-height:40px;text-align:center;text-decoration:none;width:180px" target="_blank">Leia o devocional »</a></div>\r\n									</center>\r\n									 \r\n\r\n									<p style="font-family:sans-serif;font-size:12px;line-height:1.3;color:#666666;text-align:justify">[Ouça os devocionais anteriores <a href="http://informativo.ministeriofiel.com.br/sendy/l/PaHUf8e7c763Fqrvge763GpLSA/0vAzgc8gr4Fy1LdloQLobw/JYr5892DmJA4785grH892rOUxQ" target="_blank">no YouTube</a> e <a href="http://informativo.ministeriofiel.com.br/sendy/l/PaHUf8e7c763Fqrvge763GpLSA/lijiNGROnB892AU69n8e892Ypg/JYr5892DmJA4785grH892rOUxQ" target="_blank">no Spreaker</a> ou baixe <a href="http://informativo.ministeriofiel.com.br/sendy/l/PaHUf8e7c763Fqrvge763GpLSA/pKUJNmUcZiSW763731DMZv2A/JYr5892DmJA4785grH892rOUxQ" target="_blank">o aplicativo oficial para Android</a>.]</p>\r\n									</td>\r\n								</tr>\r\n								\r\n							</tbody>\r\n						</table>\r\n						</div>\r\n						</td>\r\n					</tr>\r\n					\r\n					<tr valign="top">\r\n						<td style="line-height:80%;color:rgb(0,0,0);font-size:12x" valign="top">\r\n						<div style="color:rgb(102,102,102);text-align:center">\r\n						<p><span style="font-size:12px;color:rgb(102,102,102);line-height:1